import App, { Container } from 'next/app'
import Head from 'next/head'
import React from 'react'

export default class RootApp extends App {
    render() {
        const { Component, ...other } = this.props

        return (
            <Container>
                <Head>
                    <title>Hello React</title>
                </Head>
            </Container>
        )
    }
}
